import React from 'react';
import chair from "../../images/chair.png";
import Calendars from "./Calendars";


const Main = () => {
    return (
        <div className="row bg-dark mt-5 p-5">
            <main style={{height:"500px"}} className="justify-content-centre bg-white">
            
           <Calendars/>
            
            <div className="col-md-6 col-sm-16 bg-success">
                <img className="img-fluid" src={chair} alt=""/>

            </div>

           
        </main>
        </div>
    );
};

export default Main;
